raw_ttl:
@prefix ai: <http://ai-act.eu/ai#> .
@prefix airo: <https://w3id.org/airo#> .
@prefix dct: <http://purl.org/dc/terms/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix swrl: <http://www.w3.org/2003/11/swrl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

ai:AccessToEssencialServices rdfs:label "Access to Essential Services"@en,
        "Acceso a Servicios Esenciales"@es ;
    rdfs:comment "Referenced in Annex III, point 5."@en,
        "Referenciado en el Anexo III, punto 5."@es .

ai:AccuracyLevel a ai:TechnicalCriterion ;
    rdfs:label "Accuracy Level"@en,
        "Nivel de Exactitud"@es ;
    rdfs:comment "Criterion evaluating system accuracy across different population groups, as required by Article 15 of the EU AI Act."@en,
        "Criterio que evalúa la exactitud del sistema en diferentes grupos poblacionales, según requiere el Artículo 15 del AI Act de la UE."@es .

ai:AdaptiveCapability a ai:TechnicalCriterion ;
    rdfs:label "Adaptive Capability"@en,
        "Capacidad Adaptativa"@es ;
    rdfs:comment "Criterion for systems that continue learning after deployment, as defined in Article 3(1) of the EU AI Act."@en,
        "Criterio para sistemas que continúan aprendiendo después del despliegue, según se define en el Artículo 3(1) del AI Act de la UE."@es .

ai:AffectsFundamentalRightsRecognition a ai:ContextualCriterion ;
    rdfs:label "Affects fundamental rights recognition"@en,
        "Afecta el reconocimiento de derechos fundamentales"@es ;
    ai:assignsRiskLevel ai:HighRisk ;
    rdfs:comment "This criterion reflects situations where an AI system may influence or condition the recognition, access or exercise of fundamental rights, in line with Article 6(2) of the EU AI Act."@en,
        "Este criterio refleja situaciones en las que un sistema de IA puede influir o condicionar el reconocimiento, acceso o ejercicio de derechos fundamentales, conforme al Artículo 6(2) del AI Act."@es .

ai:BayesianModel a ai:StatisticalApproach ;
    rdfs:label "Bayesian Model"@en,
        "Modelo Bayesiano"@es ;
    rdfs:comment "Statistical model based on Bayesian inference and probability theory, used in medical diagnosis and risk assessment."@en,
        "Modelo estadístico basado en inferencia bayesiana y teoría de probabilidades, usado en diagnóstico médico y evaluación de riesgos."@es .

ai:BiometricIdentification a ai:Purpose ;
    rdfs:label "Biometric identification"@en,
        "Identificación biométrica"@es ;
    ai:activatesCriterion ai:BiometricIdentificationCriterion ;
    ai:expectedRiskLevel ai:HighRisk ;
    ai:triggersCriterion ai:BiometricIdentificationCriterion,
        ai:BiometricIdentificationOrCategorization ;
    rdfs:comment "Purpose involving biometric identification of individuals in public spaces, referenced in Annex III, point 1."@en,
        "Propósito que implica la identificación biométrica de individuos en espacios públicos, referenciado en el Anexo III, punto 1."@es .

ai:BiometricIdentificationRule a swrl:Rule .

ai:BiometricSecurityRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:BiometricData ;
                    swrl:propertyPredicate ai:processesDataType ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:BiometricSecurity ;
                    swrl:propertyPredicate ai:hasContextualCriterion ] ;
            rdf:rest () ] .

ai:Clustering a ai:UnsupervisedLearning ;
    rdfs:label "Clustering"@en,
        "Agrupamiento"@es ;
    rdfs:comment "Unsupervised learning technique for grouping similar data points."@en,
        "Técnica de aprendizaje no supervisado para agrupar puntos de datos similares."@es .

ai:ConvolutionalNeuralNetwork a ai:NeuralNetwork ;
    rdfs:label "Convolutional Neural Network"@en,
        "Red Neuronal Convolucional"@es ;
    rdfs:comment "Neural network architecture specialized for processing grid-like data such as images."@en,
        "Arquitectura de red neuronal especializada para procesar datos en forma de cuadrícula como imágenes."@es .

ai:CriticalInfrastructureOperation a ai:Purpose ;
    rdfs:label "CriticalInfrastructureOperation",
        "Critical Infrastructure Operation"@en,
        "Operación de Infraestructura Crítica"@es ;
    ai:triggersCriterion ai:CriticalInfrastructureCriterion ;
    rdfs:comment "Critical infrastructure operation purpose",
        "Referenced in Annex III, point 1(a)."@en,
        "Referenciado en el Anexo III, punto 1(a)."@es .

ai:DataEncryption a ai:TechnicalRequirement ;
    rdfs:label "DataEncryption",
        "Data Encryption"@en,
        "Cifrado de Datos"@es ;
    rdfs:comment "Data encryption requirement",
        "Technical requirement for data encryption."@en,
        "Requisito técnico para cifrado de datos."@es .

ai:DataGovernanceContext a ai:DeploymentContext ;
    rdfs:label "Data Governance Context"@en,
        "Contexto de gobernanza de datos"@es ;
    ai:assignsRiskLevel ai:HighRisk ;
    rdfs:comment "Contexts involving sensitive data processing, biometric data, or personal data requiring enhanced governance under AI Act data requirements."@en,
        "Contextos que involucran procesamiento de datos sensibles, datos biométricos o datos personales que requieren gobernanza mejorada bajo los requisitos de datos del AI Act."@es .

ai:DecisionTree a ai:SupervisedLearning ;
    rdfs:label "Decision Tree"@en,
        "Árbol de Decisión"@es ;
    rdfs:comment "Tree-based supervised learning algorithm commonly used in high-risk domains like credit scoring and medical diagnosis."@en,
        "Algoritmo de aprendizaje supervisado basado en árboles, comúnmente utilizado en dominios de alto riesgo como scoring crediticio y diagnóstico médico."@es .

ai:DimensionalityReduction a ai:UnsupervisedLearning ;
    rdfs:label "Dimensionality Reduction"@en,
        "Reducción de Dimensionalidad"@es ;
    rdfs:comment "Technique for reducing the number of features in data while preserving important information."@en,
        "Técnica para reducir el número de características en datos preservando información importante."@es .

ai:DiscriminativeCapability a ai:SystemCapability ;
    rdfs:label "Discriminative Capability"@en,
        "Capacidad Discriminativa"@es ;
    rdfs:comment "Capability to classify, categorize, or distinguish between different inputs."@en,
        "Capacidad de clasificar, categorizar o distinguir entre diferentes entradas."@es .

ai:EducationContextProtectionRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:Education ;
                    swrl:propertyPredicate ai:hasDeploymentContext ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ProtectionOfMinors ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] .

ai:EducationProtectionRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:EducationAccess ;
                    swrl:propertyPredicate ai:hasPurpose ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ProtectionOfMinors ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] .

ai:EmotionalManipulationContext a ai:DeploymentContext ;
    rdfs:label "Emotional Manipulation Context"@en,
        "Contexto de manipulación emocional"@es ;
    ai:assignsRiskLevel ai:UnacceptableRisk ;
    rdfs:comment "Contexts where AI systems exploit psychological vulnerabilities or emotional states to cause material or psychological harm, prohibited under Article 5(1)(a) of the AI Act."@en,
        "Contextos donde los sistemas de IA explotan vulnerabilidades psicológicas o estados emocionales para causar daño material o psicológico, prohibido bajo el Artículo 5(1)(a) del AI Act."@es .

ai:Employment a ai:Purpose ;
    rdfs:label "Employment" ;
    rdfs:comment "Employment and recruitment systems" .

ai:EmploymentNonDiscriminationRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:RecruitmentOrEmployment ;
                    swrl:propertyPredicate ai:hasPurpose ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:NonDiscrimination ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] .

ai:EndUser a owl:Class ;
    rdfs:label "EndUser"@en,
        "Usuario final"@es ;
    rdfs:comment "End user who interacts with the system without participating in its development or deployment."@en,
        "Usuario final que interactúa con el sistema sin intervenir en su desarrollo ni despliegue."@es ;
    rdfs:subClassOf ai:User .

ai:ExpertSystem a ai:LogicKnowledgeBasedApproach ;
    rdfs:label "Expert System"@en,
        "Sistema Experto"@es ;
    rdfs:comment "Knowledge-based system that emulates human expertise in specific domains, commonly used in medical diagnosis and legal decision support."@en,
        "Sistema basado en conocimiento que emula experiencia humana en dominios específicos, comúnmente usado en diagnóstico médico y soporte a decisiones legales."@es .

ai:FinancialServicesContext a ai:DeploymentContext ;
    rdfs:label "Financial Services Context"@en,
        "Contexto de servicios financieros"@es ;
    ai:assignsRiskLevel ai:HighRisk ;
    rdfs:comment "Contexts involving creditworthiness assessment, insurance pricing, or financial risk evaluation affecting individuals' access to financial services, regulated under Annex III of the AI Act."@en,
        "Contextos que involucran evaluación de solvencia crediticia, precios de seguros o evaluación de riesgo financiero que afecta el acceso de individuos a servicios financieros, regulado bajo el Anexo III del AI Act."@es .

ai:HealthCarePrivacyRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:HealthCare ;
                    swrl:propertyPredicate ai:hasMainPurpose ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:PrivacyProtection ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] .

ai:Healthcare a ai:DeploymentContext,
        owl:NamedIndividual ;
    rdfs:label "Healthcare"@en,
        "Salud"@es ;
    ai:triggersCriterion ai:EssentialServicesAccessCriterion ;
    rdfs:comment "Deployment context involving healthcare, medical services, or health-related activities. This context is relevant for AI systems used in diagnosis, treatment, patient management, or healthcare administration."@en,
        "Contexto de despliegue que involucra la salud, servicios médicos o actividades relacionadas con la atención sanitaria. Este contexto es relevante para sistemas de IA utilizados en diagnóstico, tratamiento, gestión de pacientes o administración sanitaria."@es .

ai:HighImpactCapabilities a ai:TechnicalCriterion ;
    rdfs:label "High Impact Capabilities"@en,
        "Capacidades de Alto Impacto"@es ;
    rdfs:comment "Criterion for models with capabilities matching advanced GPAI models."@en,
        "Criterio para modelos con capacidades equivalentes a modelos GPAI avanzados."@es .

ai:HighStakesDecisionContext a ai:DeploymentContext ;
    rdfs:label "High Stakes Decision Context"@en,
        "Contexto de decisión de alto impacto"@es ;
    ai:assignsRiskLevel ai:HighRisk ;
    rdfs:comment "Contexts where AI decisions have significant consequences for individuals' life opportunities, safety, or well-being, as recognized in AI Act risk assessment."@en,
        "Contextos donde las decisiones de IA tienen consecuencias significativas para las oportunidades de vida, seguridad o bienestar de las personas, según se reconoce en la evaluación de riesgo del AI Act."@es .

ai:HighVolumeScalabilityRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:HighVolumeProcessing ;
                    swrl:propertyPredicate ai:hasDeploymentContext ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ScalabilityRequirements ;
                    swrl:propertyPredicate ai:hasTechnicalCriterion ] ;
            rdf:rest () ] .

ai:InductiveLogicProgramming a ai:LogicKnowledgeBasedApproach ;
    rdfs:label "Inductive Logic Programming"@en,
        "Programación Lógica Inductiva"@es ;
    rdfs:comment "Machine learning approach that learns logical rules from examples."@en,
        "Enfoque de aprendizaje automático que aprende reglas lógicas a partir de ejemplos."@es .

ai:InterfaceSpec a owl:Class ;
    rdfs:label "Interface Specification"@en,
        "Interface Specification"@es ;
    rdfs:comment "Especificación técnica de una interfaz utilizada por un sistema de inteligencia artificial para comunicarse con otros sistemas o usuarios."@en,
        "Especificación técnica de una interfaz utilizada por un sistema de inteligencia artificial para comunicarse con otros sistemas o usuarios."@es ;
    rdfs:subClassOf ai:Identifiable .

ai:JudicialDecisionSupport a ai:Purpose ;
    rdfs:label "JudicialDecisionSupport",
        "Judicial Decision Support"@en,
        "Apoyo a la decisión judicial"@es ;
    ai:triggersCriterion ai:JudicialSupportCriterion ;
    rdfs:comment "Judicial decision support purpose",
        "Referenced in Annex III, point 6."@en,
        "Referenciado en el Anexo III, punto 6."@es .

ai:KnowledgeGraph a ai:LogicKnowledgeBasedApproach ;
    rdfs:label "Knowledge Graph"@en,
        "Grafo de Conocimiento"@es ;
    rdfs:comment "Graph-based knowledge representation system for storing and querying structured information."@en,
        "Sistema de representación de conocimiento basado en grafos para almacenar y consultar información estructurada."@es .

ai:LawEnforcementDueProcessRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:LawEnforcement ;
                    swrl:propertyPredicate ai:hasMainPurpose ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:DueProcess ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] .

ai:LawEnforcementSupport a ai:Purpose ;
    rdfs:label "LawEnforcementSupport",
        "Law Enforcement Support"@en,
        "Apoyo a la aplicación de la ley"@es ;
    ai:triggersCriterion ai:LawEnforcementCriterion ;
    rdfs:comment "Law enforcement support purpose",
        "Referenced in Annex III, point 7."@en,
        "Referenciado en el Anexo III, punto 7."@es .

ai:LimitedTransparencyContext a ai:DeploymentContext ;
    rdfs:label "Limited Transparency Context"@en,
        "Contexto de transparencia limitada"@es ;
    ai:assignsRiskLevel ai:LimitedRisk ;
    rdfs:comment "Contexts where AI systems interact with users but may not be immediately recognizable as AI, requiring transparency obligations under Article 52 of the AI Act."@en,
        "Contextos donde los sistemas de IA interactúan con usuarios pero pueden no ser inmediatamente reconocibles como IA, requiriendo obligaciones de transparencia bajo el Artículo 52 del AI Act."@es .

ai:LinearRegression a ai:SupervisedLearning ;
    rdfs:label "Linear Regression"@en,
        "Regresión Lineal"@es ;
    rdfs:comment "Basic supervised learning algorithm for modeling linear relationships."@en,
        "Algoritmo básico de aprendizaje supervisado para modelar relaciones lineales."@es .

ai:LoggingRequirement a owl:Class ;
    rdfs:label "Logging Requirement"@en,
        "Requisito de registro de eventos"@es ;
    rdfs:comment "Technical requirement for AI systems to log events or actions for traceability and accountability."@en,
        "Requisito técnico para que los sistemas de IA registren eventos o acciones para trazabilidad y rendición de cuentas."@es ;
    rdfs:subClassOf ai:TechnicalRequirement .

ai:LogisticRegression a ai:SupervisedLearning ;
    rdfs:label "Logistic Regression"@en,
        "Regresión Logística"@es ;
    rdfs:comment "Supervised learning algorithm for binary and multiclass classification."@en,
        "Algoritmo de aprendizaje supervisado para clasificación binaria y multiclase."@es .

ai:LowRiskGeneralContext a ai:DeploymentContext ;
    rdfs:label "Low Risk General Context"@en,
        "Contexto general de bajo riesgo"@es ;
    ai:assignsRiskLevel ai:MinimalRisk ;
    rdfs:comment "General deployment contexts with minimal risk to fundamental rights, safety, or societal values, requiring no specific obligations under the AI Act."@en,
        "Contextos generales de despliegue con riesgo mínimo para derechos fundamentales, seguridad o valores sociales, sin requerir obligaciones específicas bajo el AI Act."@es .

ai:MassPublicSurveillanceContext a ai:DeploymentContext ;
    rdfs:label "Mass Public Surveillance Context"@en,
        "Contexto de vigilancia pública masiva"@es ;
    ai:assignsRiskLevel ai:UnacceptableRisk ;
    rdfs:comment "Contexts involving indiscriminate surveillance or mass data collection that threatens democratic values and fundamental rights, prohibited under the AI Act."@en,
        "Contextos que involucran vigilancia indiscriminada o recolección masiva de datos que amenaza valores democráticos y derechos fundamentales, prohibido bajo el AI Act."@es .

ai:MigrationControl a ai:Purpose,
        owl:NamedIndividual ;
    rdfs:label "MigrationControl",
        "Migration Control"@en,
        "Control migratorio"@es ;
    ai:activatesCriterion ai:MigrationBorderCriterion ;
    ai:expectedRiskLevel ai:HighRisk ;
    ai:triggersCriterion ai:MigrationBorderCriterion ;
    rdfs:comment "Migration control purpose",
        "Migration, asylum and border control management."@en,
        "Gestión de migración, asilo y control fronterizo."@es .

ai:MinorConsentRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ProtectionOfMinors ;
                    swrl:propertyPredicate ai:hasNormativeCriterion ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ParentalConsent ;
                    swrl:propertyPredicate ai:hasRequirement ] ;
            rdf:rest () ] .

ai:MinorDataProtectionRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:MinorData ;
                    swrl:propertyPredicate ai:processesDataType ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:ChildProtection ;
                    swrl:propertyPredicate ai:hasContextualCriterion ] ;
            rdf:rest () ] .

ai:ModelInterpretability a ai:TechnicalCriterion ;
    rdfs:label "Model Interpretability"@en,
        "Interpretabilidad del Modelo"@es ;
    rdfs:comment "Criterion evaluating system's ability to provide explanations for decisions, as required by Article 13 of the EU AI Act."@en,
        "Criterio que evalúa la capacidad del sistema para proporcionar explicaciones de decisiones, según requiere el Artículo 13 del AI Act de la UE."@es .

ai:OptimizationMethod a ai:StatisticalApproach ;
    rdfs:label "Optimization Method"@en,
        "Método de Optimización"@es ;
    rdfs:comment "Mathematical optimization and search algorithms for finding optimal solutions."@en,
        "Algoritmos matemáticos de optimización y búsqueda para encontrar soluciones óptimas."@es .

ai:PerformanceLatencyRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:PerformanceRequirements ;
                    swrl:propertyPredicate ai:hasTechnicalCriterion ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:LatencyMetrics ;
                    swrl:propertyPredicate ai:hasTechnicalRequirement ] ;
            rdf:rest () ] .

ai:PerformanceMonitoringRequirement a ai:TechnicalRequirement ;
    rdfs:label "PerformanceMonitoringRequirement",
        "Performance Monitoring Requirement"@en,
        "Requisito de Monitoreo de Rendimiento"@es ;
    rdfs:comment "Performance monitoring requirement",
        "Technical requirement for performance monitoring."@en,
        "Requisito técnico para monitoreo de rendimiento."@es .

ai:PostDeploymentAssessment a owl:Class ;
    rdfs:label "PostDeployment Assessment"@en,
        "Evaluación posterior al despliegue"@es ;
    rdfs:comment "Risk assessment or evaluation performed after the deployment of an AI system."@en,
        "Evaluación o valoración de riesgos realizada tras el despliegue de un sistema de IA."@es ;
    rdfs:subClassOf ai:RiskAssessment .

ai:PreDeploymentAssessment a owl:Class ;
    rdfs:label "PreDeployment Assessment"@en,
        "Evaluación previa al despliegue"@es ;
    rdfs:comment "Risk assessment or evaluation performed before the deployment of an AI system."@en,
        "Evaluación o valoración de riesgos realizada antes del despliegue de un sistema de IA."@es ;
    rdfs:subClassOf ai:RiskAssessment .

ai:PredictiveCapability a ai:SystemCapability ;
    rdfs:label "Predictive Capability"@en,
        "Capacidad Predictiva"@es ;
    rdfs:comment "Capability to make predictions about future events or outcomes."@en,
        "Capacidad de hacer predicciones sobre eventos o resultados futuros."@es .

ai:ProcessingCapacity a ai:TechnicalCriterion ;
    rdfs:label "Processing Capacity"@en,
        "Capacidad de Procesamiento"@es ;
    rdfs:comment "Criterion for high-volume, real-time processing capabilities, relevant for foundation models under Article 51 of the EU AI Act."@en,
        "Criterio para capacidades de procesamiento de alto volumen, tiempo real, relevante para modelos fundacionales bajo el Artículo 51 del AI Act de la UE."@es .

ai:ProfessionalUser a owl:Class ;
    rdfs:label "ProfessionalUser"@en,
        "Usuario profesional"@es ;
    rdfs:comment "Professional user who uses the system in the exercise of their profession."@en,
        "Usuario profesional que utiliza el sistema en el ejercicio de su profesión."@es ;
    rdfs:subClassOf ai:User .

ai:PublicServiceAllocation a ai:Purpose,
        owl:NamedIndividual ;
    rdfs:label "Public Service Allocation"@en,
        "Asignación de servicios públicos"@es ;
    ai:activatesCriterion ai:EssentialServicesAccessCriterion ;
    ai:expectedRiskLevel ai:HighRisk ;
    ai:triggersCriterion ai:EssentialServicesAccessCriterion ;
    rdfs:comment "Determination of access to essential public services."@en,
        "Determinación de acceso a servicios públicos esenciales."@es .

ai:PublicServices a ai:DeploymentContext,
        owl:NamedIndividual ;
    rdfs:label "Public Services"@en,
        "Servicios Públicos"@es ;
    ai:triggersCriterion ai:EssentialServicesAccessCriterion ;
    rdfs:comment "Deployment context involving public services."@en,
        "Contexto de despliegue que involucra servicios públicos."@es .

ai:RandomForest a ai:SupervisedLearning ;
    rdfs:label "Random Forest"@en,
        "Bosque Aleatorio"@es ;
    rdfs:comment "Ensemble learning method using multiple decision trees, widely used in financial and healthcare risk assessment."@en,
        "Método de aprendizaje en conjunto que utiliza múltiples árboles de decisión, ampliamente usado en evaluación de riesgos financieros y sanitarios."@es .

ai:RealTimePerformanceRule a swrl:Rule ;
    swrl:body [ a swrl:AtomList ;
            rdf:first [ a swrl:IndividualPropertyAtom ;
                    swrl:argument1 [ a swrl:Variable ;
                            rdfs:label "system" ] ;
                    swrl:argument2 ai:RealTimeProcessing ;
                    swrl:propertyPredicate ai:hasDeploymentContext ] ;
            rdf:rest () ] ;
    swrl:head [ a swrl:AtomList ;
